import React, { useState } from 'react';
import SearchBar from 'material-ui-search-bar';

function Searchbar() {
  const [value, setValue] = useState(0);

  return (
    <React.Fragment>
      <SearchBar
        value={value}
        onChange={(newValue) => setValue(newValue)}
        onRequestSearch={() => console.log(value)}
      />
    </React.Fragment>
  );
}

export default Searchbar;
